try {
  let input = items[0].json.output;
  if (!input) {
    throw new Error('No valid output from AI Agent.');
  }
  let parsedOutput = JSON.parse(input);
  return [{ json: parsedOutput }];
} catch (e) {
  // If parsing fails, return a default valid JSON object
  return [{
    json: {
      "chatMessage": "I am a medical insights assistant. Please ask a health-related question or upload a report.",

    }
  }];
}
